import React from "react";
import "./Korpica.css";

export default function Korpica({ itemsCart }) {
  return (
    <div className="korpicaa">
      {itemsCart.map((item) => {
        <div key={item.id}>
          {item.title} {item.kolicina}
        </div>;
      })}
    </div>
  );
}
